import { library } from "@fortawesome/fontawesome-svg-core";
import { fas } from "@fortawesome/free-brands-svg-icons";
import { faCheck, faSquare } from "@fortawesome/free-solid-svg-icons";

library.add(fas, faCheck, faSquare);
